    const [courses, setCourses] = useState([]);
    



    return (
        <div className="App">
            <h1>Course List</h1>
            <Table striped bordered hover variant="dark">
               { <thead>
                    <tr>
                        <th>#</th>
                        <th>Course</th>
                        <th>Description</th>
                        <th>Actions</th>

                    </tr>
                </thead>
}
                <tbody>
                    {

                        <tr>
                            <td></td>
                            <td></td>
                            <td></td>


                            <td><FaEdit />   |   

                                <button
                                    className="button"
                                >
                                    <FaTrash />
                                </button>

                            </td>

                        </tr>

                    }

                </tbody>
            </Table>

        </div>

    );
}
export default CourseList;
